		<Container id="main-container" className="d-grid h-100"> 
			<img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3ADyson_logo.svg&psig=AOvVaw29WMQdlRvemzqSaeGSkEkR&ust=1652205195127000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCMiTh_H-0vcCFQAAAAAdAAAAABAD"/>
			<SearchBar />
		</Container>
	)
}


export default App;
